function shodanFunc3(ip, shodanAPIKey){
  return new Promise((resolve) => {
      shodanClient
      .host(ip, shodanAPIKey, history=false)
      .then(res => {
        resolve(res);
      })
      .catch(err => resolve("No Info"));
  })
}
