async function ipinfoShodanFunc(ip){
  return new Promise((resolve, reject) => {
    ipInfo(ip, 'b3f54ca780db8a', (err, cLoc) => {
        if(err) reject(err);
        var hostname;
        if (cLoc.hostname == undefined){
          var hostname = "Could Not Resolved";
        }
        else{
          hostname = cLoc.hostname;
        }
        resolve(hostname);
    });
  });
}
